import React from 'react'
import "./Header.css"
import logo from "../Assets/finalBackground.png"

export const Header = () => {
  return (
    <div className='NavBar'>
      <div className="leftside">
        <img src={logo} alt='hello'/>
      </div>
      <div className="rightside"></div>
    </div>
  )
}

export default Header;
